import React from 'react';

import Login from './components/Login';
import Register from './components/Register';
import Home from './components/Home';
import { ReactTable } from 'react-table'

import { BrowserRouter as Router, Route } from "react-router-dom";


function App() {
  const data = [
    { district: "Wan Chai", building: "Block C, Villa Lotto", cases: "2", ages: ["21", "24"], resident: "HK Resident", date: "05/03/2020" },
    { district: "Tai Po", building: "Tower 1, La Grove", cases: "1", ages: ["45"], resident: "Non-local", date: "05/04/2020" },
    { district: "Central and Western", building: "18 Stanley Main Street", cases: "1", ages: ["33"], resident: "HK Resident", date: "11/03/2020" },
    { district: "Wan Chai", building: "Block C, Villa Lotto", cases: "2", ages: ["21", "24"], resident: "HK Resident", date: "05/03/2020" },
    { district: "Tai Po", building: "Tower 1, La Grove", cases: "1", ages: ["45"], resident: "Non-local", date: "05/04/2020" },
    { district: "Central and Western", building: "18 Stanley Main Street", cases: "1", ages: ["33"], resident: "HK Resident", date: "11/03/2020" },
    { district: "Wan Chai", building: "Block C, Villa Lotto", cases: "2", ages: ["21", "24"], resident: "HK Resident", date: "05/03/2020" },
    { district: "Tai Po", building: "Tower 1, La Grove", cases: "1", ages: ["45"], resident: "Non-local", date: "05/04/2020" },
    { district: "Central and Western", building: "18 Stanley Main Street", cases: "1", ages: ["33"], resident: "HK Resident", date: "11/03/2020" },
  ];

  const columns = [
    {
      Header: "District",
      accessor: "district"
    },
    {
      Header: "Building",
      accessor: "building"
    },
    {
      Header: "Case No.",
      accessor: "cases"
    },
    {
      Header: "Ages",
      accessor: "ages"
    },
    {
      Header: "HK/Non-HK Resident",
      accessor: "resident"
    },
    {
      Header: "Date",
      accessor: "date"
    }
  ]
  return (
    <ReactTable columns={columns}
      data={data} >

    </ReactTable>
  )
}

export default App;



